import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function Navbar({ user, cartCount, onLogout }) {
  const navigate = useNavigate();

  return (
    <nav className="bg-white shadow-md sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <div className="flex items-center cursor-pointer" onClick={() => navigate('/')}>
            <h1 className="text-2xl font-bold text-blue-600">üõçÔ∏è RECO</h1>
            <p className="ml-2 text-sm text-gray-600">Recommandations Intelligentes</p>
          </div>

          {/* Nav Links */}
          <div className="hidden md:flex space-x-6 items-center">
            <button
              onClick={() => navigate('/')}
              className="text-gray-700 hover:text-blue-600 transition"
            >
              Accueil
            </button>
            <button
              onClick={() => navigate('/wishlist')}
              className="text-gray-700 hover:text-blue-600 transition"
            >
              ‚ù§Ô∏è Liste de souhaits
            </button>
            <button
              onClick={() => navigate('/cart')}
              className="relative text-gray-700 hover:text-blue-600 transition"
            >
              üõí Panier
              {cartCount > 0 && (
                <span className="absolute -top-2 -right-2 bg-red-500 text-white text-xs rounded-full w-5 h-5 flex items-center justify-center">
                  {cartCount}
                </span>
              )}
            </button>
            <button
              onClick={() => navigate('/purchases')}
              className="text-gray-700 hover:text-blue-600 transition"
            >
              üì¶ Mes achats
            </button>
          </div>

          {/* User Menu */}
          <div className="flex items-center space-x-4">
            <span className="text-gray-700 font-medium">
              Bonjour, <span className="text-blue-600">{user.firstName}</span>
            </span>
            <button
              onClick={onLogout}
              className="px-4 py-2 bg-red-500 text-white rounded-lg hover:bg-red-600 transition"
            >
              D√©connexion
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
}
